sys_variable_value.value:
 try { 
 var r = new sn_ws.RESTMessageV2('x_535856_dept_re_0.SailPoint IdentityIQ SCIM API', 'Launch LCM Provisioning');
 gs.info('rolename: ' + workflow.inputs.u_rolename);
 gs.info('requestedfor: ' + workflow.inputs.u_requestedfor);
 gs.info('workflowname: ' + workflow.inputs.u_workflowname);
 gs.info('sailpointurl: ' + workflow.inputs.u_sailpointurl);
 gs.info('requestedby: ' + workflow.inputs.u_requestedby);
 
 r.setStringParameterNoEscape('rolename', workflow.inputs.u_rolename);
 r.setStringParameterNoEscape('requestedfor', workflow.inputs.u_requestedfor);
 r.setStringParameterNoEscape('workflowname', workflow.inputs.u_workflowname);
 r.setStringParameterNoEscape('sailpointurl', workflow.inputs.u_sailpointurl);
 r.setStringParameterNoEscape('requestedby', workflow.inputs.u_requestedby);
 
 var response = r.execute();
 var responseBody = response.getBody();
 var httpStatus = response.getStatusCode();
 
 gs.info('responseBody: ' + responseBody);
 gs.info('httpStatus: ' + httpStatus);

 var json= JSON.parse(responseBody);
 var identityRequestId = json.attributes[0].value;	
 workflow.scratchpad.identityRequestId = identityRequestId;
 gs.info('RequestedItem: ' + identityRequestId); 
}
catch(ex) {
 var message = ex.message;
	 gs.info('Message: ' + message); 
}

